Your SphygmoCor Reference age measures the stiffness of your arteries and compares them with other people your age.
{0}
If this age is less than your actual age: Congratulations you have young arteries. If this age is the same as your actual age: Your arterial stiffness is normal for your age. If this age is greater than your actual age: Your arteries are stiffer than is normal for your age and you should discuss this with your Doctor, who may suggest lifestyle changes and/ medication to reduce your arterial stiffness.
